import React from "react";
import VideoPlayer from './VideoJS' // point to where the functional component is stored

const App = () => {
  const videoJsOptions = {
    autoplay: true,
    controls: true,
    sources: [{
      src: '/path/to/video.mp4',
      type: 'video/mp4'
    }]
  }

  return <VideoPlayer { ...videoJsOptions } />
}
export default App;
